import React, { useState } from 'react';
import api from '../api'; // Ensure this points to your API setup
import './RegisterAgentPopup.css'; // Import CSS for styling

const RegisterAgentPopup = ({ onClose }) => {
  const [agentData, setAgentData] = useState({
    name: '',
    email: '',
    password: '',
    confirmPassword: '',
    role: 'agent'
  });
  const [errorMessage, setErrorMessage] = useState('');

  const validateEmail = (email) => /\S+@\S+\.\S+/.test(email);

  const validatePassword = (pwd) => {
    if (pwd.length < 8) return 'Password must be at least 8 characters long';
    if (!/[A-Z]/.test(pwd)) return 'Password must contain at least one uppercase letter';
    if (!/[a-z]/.test(pwd)) return 'Password must contain at least one lowercase letter';
    if (!/[0-9]/.test(pwd)) return 'Password must contain at least one number';
    if (!/[!@#$%^&*(),.?":{}|<>]/.test(pwd)) return 'Password must contain at least one special character';
    return '';
  };

  const handleRegister = async (e) => {
    e.preventDefault();
    setErrorMessage('');

    // Name validation: At least 3 characters
    if (agentData.name.length < 3) {
      setErrorMessage('Name must be at least 3 characters long.');
      return;
    }

    if (!validateEmail(agentData.email)) {
      setErrorMessage('Please enter a valid email address.');
      return;
    }

    const passwordError = validatePassword(agentData.password);
    if (passwordError) {
      setErrorMessage(passwordError);
      return;
    }

    if (agentData.password !== agentData.confirmPassword) {
      setErrorMessage('Passwords do not match.');
      return;
    }

    try {
      const { data } = await api.post('/users/registerAgent', agentData); // Update this endpoint as needed
      alert('Agent registered successfully!');
      onClose(); // Close the popup
    } catch (error) {
      setErrorMessage('Failed to register agent.');
      console.error('Error registering agent:', error);
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setAgentData({
      ...agentData,
      [name]: value
    });
  };

  return (
    <div className="popup-overlay">
      <div className="popup-content">
        <button className="close-button" onClick={onClose}>X</button>
        <h2>Register Agent</h2>
        {errorMessage && <p className="error-message">{errorMessage}</p>}
        <form onSubmit={handleRegister}>
          <div className="form-group">
            <label htmlFor="name">Name</label>
            <input
              type="text"
              id="name"
              name="name"
              value={agentData.name}
              onChange={handleChange}
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="email">Email</label>
            <input
              type="email"
              id="email"
              name="email"
              value={agentData.email}
              onChange={handleChange}
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="password">Password</label>
            <input
              type="password"
              id="password"
              name="password"
              value={agentData.password}
              onChange={handleChange}
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="confirmPassword">Confirm Password</label>
            <input
              type="password"
              id="confirmPassword"
              name="confirmPassword"
              value={agentData.confirmPassword}
              onChange={handleChange}
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="role">Role</label>
            <select
              id="role"
              name="role"
              value={agentData.role}
              onChange={handleChange}
              required
            >
              <option value="agent">Agent</option>
              <option value="manager">Manager</option>
            </select>
          </div>
          <button type="submit">Register</button>
        </form>
      </div>
    </div>
  );
};

export default RegisterAgentPopup;
